import React from 'react';
import './home-style.css';
import Navigation from './Navigation/Navigation.js';


const HomePage = () => {
  	return (
  		<div>
			<Navigation onRouteChange={this.onRouteChange}/>
		</div>
  	);

}

export default HomePage;
